import React, { useState } from "react";

function Todolist() {
  const [todoList, setTodo] = useState([]);
  const [todoname, setName] = useState("");

  const setTodoName = (e) => {
    setName(e.target.value);
  };

  const addTodoButton = () => {
    setTodo([...todoList, todoname]);
  };

  return (
    <div>
      <h1>todoList</h1>
      <input
        onChange={setTodoName}
        value={todoname}
        placeholder="addtodo"
      ></input>
      <button onClick={addTodoButton}>add</button> 
      <p></p>
      
    </div>
  );
}
export default Todolist
